import React from 'react';
import linkWeatherIcon from '../icons/links-rain.svg';
import { Link } from 'react-router-dom';
import './Linkbar.css';
import linkPortalAluno from '../icons/links-aluno.svg';
import linkMoodle from '../icons/links-moodle.svg';

function Linkbar() {
  return (
    <>
        <nav className='linkbar'>
            <div className='linkbar-container'>

                        <Link to="/" className="link-clima">
                            <figure>
                                <img src={linkWeatherIcon} alt="Clima Patos de Minas" />
                            </figure>
                            Patos de Minas 23 °C / 19 °C
                        </Link>

                        <ul className='link-menu'>
                            
                            <li className='link-item'>
                                <Link to='/' className='link-links'>
                                    <img src={linkPortalAluno} alt="Portal do Aluno" />
                                    Portal do Aluno
                                </Link>
                            </li>

                            <li className='link-item'>
                                <Link to='/' className='link-links'>
                                    <img src={linkMoodle} alt="Moodle UFU" />
                                    <p className='pMoodle'>Moodle UFU</p>
                                </Link>
                            </li>

                        </ul>
                        
            </div>
        </nav>
    </>
    );
}

export default Linkbar;
